import Vue from 'vue'
import Router from "vue-router";

import Body from '../components/body'
import SamplePage from '../pages/sample_page'

/* Authentication */
import login from '../auth/login'
import Register from '../auth/register'


// component

Vue.use(Router)

const routes = [
  { path: '', redirect: { name: 'default' }},
  {
    path: '/dashboard',
    component: Body,
    children: [
    {
      path: 'default',
      name: 'default',
      component: SamplePage,
      meta: {
        title: 'Default Dashboard | Endless - Premium Admin Template',
      }
    },
    {
      path: 'ecommerce',
      name: 'ecommerce',
      component: SamplePage,
      meta: {
        title: 'Ecommerce Dashboard | Endless - Premium Admin Template',
      }
    },
    ]
  },
  {
    path: '/login',
    name: 'login',
    component: login,
    meta: {
      title: 'Login | Endless - Premium Admin Template',
    }
  },
  {
    path: '/register',
    name: 'register',
    component: Register,
    meta: {
      title: 'Register | Endless - Premium Admin Template',
    }
  },];

const router = new Router({
  routes,
  base: '/',
  mode: 'history',
  linkActiveClass: "active",
  scrollBehavior () {
    return { x: 0, y: 0 }
  }
});

export default router
